const soundcloud=(()=>{for(const n of document.querySelectorAll(".Soundcloud")){const s=document.createElement("iframe");s.className="Soundcloud-iframe",s.setAttribute("src",`https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/${n.getAttribute("data-id")}&show_comments=false`);const t=document.createElement("a");t.setAttribute("href","https://soundcloud.com/pages/cookies"),t.textContent="cookie policy",t.onclick=e=>e.stopPropagation(),t.onkeydown=e=>e.stopPropagation();const e=document.createElement("div");e.className="Soundcloud-player",e.setAttribute("tabindex","0"),e.textContent="Load player",e.appendChild(t),e.onclick=()=>n.replaceChild(s,e),e.onkeydown=t=>{t.keyCode==13&&n.replaceChild(s,e)},n.appendChild(e)}})()